import React from "react";

//styles

import styles from "../styles";
import boxproduts from "./boxproduts";
//items list
import produts from "../items";
import BoxProdut from "./boxproduts";

const ProdutList = (props) => {
  const itemsList = produts.map((produt) => <BoxProdut />);
  return <div style={styles.list}>{itemsList}</div>;
};

export default ProdutList;
